from sympy.ntheory import digits
def s(v): return sum(v[::2]) - sum(v[1::2])
def a(n): return sum(1 for b in range(2, n) if s(digits(n, b)[1:]) == 0)
print([a(n) for n in range(1, 87)]) # _Michael S. Branicky_, May 24 2025

